210 Tahun Tambora: Letusan Dahsyat yang Mengubah Dunia

11 April 1815 — Gunung Tambora menunjukkan letusan paripurnanya. Dentumannya mengguncang dunia, langit menghitam, dan ribuan jiwa musnah.

Letusan dahsyat Tambora dimulai pada 10 April 1815 pukul 7 malam, lalu terus meningkat dalam intensitas hingga akhirnya menciptakan tiga kolom api yang menjulang dari puncaknya, membelah langit dengan spektakuler.

Letusan berkekuatan VEI 7 ini memangkas puncaknya dari 4.300 mdpl menjadi 2.851 mdpl, menciptakan kaldera raksasa: diameter 7 km dengan kedalaman lebih dari 1,1 km, dan memicu “Tahun Tanpa Musim Panas” di belahan bumi utara.

Dua kerajaan terkubur musnah. Dunia terguncang. Indonesia pun tercatat dalam sejarah geologi global.

Swipe dan yuk! Kenali kembali kisah sang raksasa yang pernah mengguncang langit dan bumi ini.

