Pemasangan kamera jebak (camera trap) di kawasan TN Tambora
.
Sebagai upaya dalam konservasi keanekaragaman hayati di TN Tambora, telah dilakukan pemasangan kamera jebak. Sebanyak 4 unit kamera jebak dipasang selama 80 hari di wilayah kerja SPTN Wilayah I Kore dan SPTN Wikayah II Pekat.
.
Kamera jebak menjadi metode paling diandalkan untuk mendokumentasikan satwa-satwa liar yang berkeliaran bebas tanpa mengakibatkan gangguan atau ancaman yang berarti bagi satwa. Kamera ini dipasang untuk mengamati aktivitas dan perilaku satwa, khususnya mamalia terestrial, di alam. Hasil dokumentasi dari kamera jebak dapat menjadi bukti keberadaan satwa liar.
.
Dari hasil dokumentasi yang diperoleh, dapat melengkapi data keanekaragaman hayati Balai TN Tambora yang nantinya akan menjadi dasar dalam menyusun kebijakan dan rencana pengelolaan.
.
