Jakarta 19 November 2024.
.
bertempat di Ruang Rapat Badan Geologi, Gedung BP2SDM Lantai V, Jl. Gatot Subroto KAV 49 Jakarta Selatan, Kepala Balai Taman Nasional Tambora bersama Kepala Pusat Vulkanologi dan Mitigasi Bencana Geologi melakukan Finalisasi dan Penandatanganan Perjanjian Kerja Sama (PKS) dan Rencana Pelaksanaan Program (RPP) Kerja Sama Modernisasi Peralatan Mitigasi Gunungapi antara Taman Nasional Tambora dengan Pusat Vulkanologi dan Mitigasi Bencana Geologi dengsn Jangka waktu perjanjian kerja sama selama 10 (sepuluh) tahun sejak ditandatangani.
.
Tujuan perjanjian kerja sama ini untuk mendukung terwujudnya penguatan tata kelola pengelolaan kawasan TN Tambora dan meminimalkan dampak negatif baik langsung maupun tidak langsung sebagai akibat kegiatan pembangunan dan/atau modernisasi peralatan untuk mitigasi bencana gunung api di TN Tambora.

​​​​Dengan Ruang lingkup meliputi:
a. Pembangunan dan/atau modernisasi stasiun peralatan pemantauan aktivitas gunung api di TN Tambora;
b. Dukungan Perlindungan dan Pengamanan Kawasan;
c. Dukungan Penguatan Kelembagaan;
d. Pemberdayaan Masyarakat;
e. Perencanaan, Monitoring, Evaluasi, dan Pelaporan.

Kegiatan ini dihadiri pula oleh Direktorat Teknis Ditjen KSDAE yaitu Direktorat Perencanaan Kawasan Konservasi, Direktorat PJLKK, Sekbadan Geologi.

